import { NavLink } from 'react-router-dom';
import './GalleryNavigation.css';

function GalleryNavigation({ galleries }) {
    return (
        <nav>
            <NavLink to='/'>Home</NavLink>
            {
                galleries.map((gallery) => {
                    return (
                        <NavLink
                            to={`/galleries/${gallery.id}`}
                            key={gallery.id}>
                            {gallery.name}
                        </NavLink>
                    )
                })
            }
        </nav>
    );
}

export default GalleryNavigation;
